description:
NowThis Impact spoke to the executive producer of Sesame Street about the profound influence of children’s public media after the organization received the Elevate Catalyst Award at the Make Good Famous Summit.

The award — presented by Elevate Prize Foundation CEO Carolina Garcia Jayaram — includes a $250,000 grant so Sesame Workshop can continue expanding its global impact on education.

